import { Row, Col, Button } from 'antd';
function Home() {
  return (
    <>
      <Row gutter={16}>
        <Col
          offset={21}
          style={{ margin: '2em 0 0 2em', backgroundColor: 'darkgrey' }}
        >
          <Button type="danger">APP</Button>
        </Col>
      </Row>
    </>
  );
}

export default Home;
